INSERT INTO `suggestions` VALUES (1,52,16,1,'Nil','2020-01-13','23:01:09','Prompt attention to request should be adopted'),(2,52,18,1,'The way Segun Akolade will attend to request','2020-01-13','23:03:51','Feedback and more communication'),(3,26,16,1,'Promptness','2020-01-13','23:22:12',''),(4,26,18,1,'Quick to respond. The staff are quick on their feet.','2020-01-13','23:22:55',''),(5,26,15,1,'Compassionate staff','2020-01-13','23:23:19',''),(6,26,22,1,'Innovative staff','2020-01-13','23:23:35',''),(7,26,9,1,'Great staff','2020-01-13','23:23:52',''),(8,26,7,1,'Great staff','2020-01-13','23:24:12',''),(9,213,6,1,'I love your prompt attention to all our requests. You have never delayed our request for review of agency remunerations. You even ask questions when you do not get notified early. That shows you are committed to what you do. Bravo!','2020-01-14','00:31:32','Please keep up the good work'),(10,213,10,1,'Always ready and willing to meet target even in harsh economic conditions','2020-01-14','00:37:05','1. Pay attention to details\r\n2. Send notifications promptly\r\n3. Show more commitment to administrative part of the Retail Team'),(11,213,17,1,'Team spirit, commitment to your job.','2020-01-14','00:41:36','1. Better Time Management\r\n2. Better Time Management. Ensure you prioritize requests sent to you especially those affecting the strongest sales channel as any form of demotivation to them would spell doom for the company at the moment.'),(12,213,14,1,'Quick response to requests and commitment to work','2020-01-14','00:45:05','1. Better Time Management (Faster premium upload)\r\n2. Prompt Direct Debit Setup & Cancellation\r\n3. Prompt reconciliation f premium issues'),(13,213,21,1,'Team spirit and commitment to work','2020-01-14','00:46:54','Improved feedback'),(14,86,16,1,'THE WAY IN WHICH THE DEPARTMENT CARRIES OUT THEIR WORK','2020-01-14','14:01:19',''),(15,59,18,1,'There is room for improvement.','2020-01-14','14:13:06','Communication between staff memebrs and Admin is poor.\r\nIf the staff bus will not be availbale for use, staff members should be informed at least so we can make alternative plans instead of being taken by surprise at close of business'),(16,59,11,1,'Good team. Good attitude to work. well done and keep it up.','2020-01-14','14:15:33','be more involved in non annuity issues'),(17,59,13,1,'Foolow up with client&#39;s request is good.\r\nWell done Tobe.','2020-01-14','14:17:45','Feedback to people who forward requests is important so they can readily supply update to clients when called upon.'),(18,59,3,1,'Involvement in crisis when clients escalate issues in the office.\r\nThank you Macaulay for all the times you stepped in to appease an angry client.\r\nYou are appreciated a great deal and keep it up.','2020-01-14','14:26:03','Feedback! Feedback is very important.\r\nPlease respond to your mails ,just say something at least so we can confidently communicate to our clients when feedback concerning  payment is needed.\r\nIt is sad that even when an issue is escalated and a mail is sent,one rarely gets an immediate response from Finance.'),(19,113,18,1,'NONE','2020-01-14','14:27:51','Improve on reorder basic items in the office'),(20,113,22,1,'none','2020-01-14','14:32:12','none'),(21,59,4,1,'Very friendly team as usual.\r\nThank you TOKE for always going extra miles to check on one&#39;s well being.\r\nWell done ma.','2020-01-14','14:31:24','There is always room for improvement.'),(22,113,16,1,'none','2020-01-14','14:31:55','none'),(23,59,5,1,'Good team.','2020-01-14','14:33:18','There is always room for bus stop.'),(24,113,11,1,'none','2020-01-14','14:35:07','none'),(25,113,13,1,'none','2020-01-14','14:35:50','none'),(26,212,16,1,'Promptness in handling issues.','2020-01-14','14:35:55','NIL'),(27,113,9,1,'none','2020-01-14','14:36:41','none'),(28,220,15,1,'following up issues','2020-01-14','14:36:52','to be more attentive to customers and picking of phone calls'),(29,113,15,1,'none','2020-01-14',